using System;
using UnityEngine;
using UnityEngine.Rendering;

/* Add this to your main camera
*Essentially, we are scaling the pixel rect of the cam down prior to render, blitting after render,
*then trying to scale back up after (so we are rendering with fewer fragments)
*/
public class CameraResolutionScaler : MonoBehaviour
{
    //public
    public enum currentResolution
    {
        [Tooltip("960x544")] Full,
        [Tooltip("720x408")] Mid,
        [Tooltip("640x363")] Low,
        [Tooltip("480x272")] PSP
    }
    public enum internalResolution
    {
        [Tooltip("960x544")] Full,
        [Tooltip("720x408")] Mid,
        [Tooltip("640x363")] Low,
        [Tooltip("480x272")] PSP
    }
    public bool enableInternalResolution = true;
    public internalResolution InternalResolution;
    public currentResolution screenResolution;
    public FilterMode filterMode = FilterMode.Trilinear;
    //serialized for debug to make sure calculation is correct
    [SerializeField] private int hDiv = 0;
    [SerializeField] private int vDiv = 0;
    //private
    private int height;    
    private int width;
    private float renderDivisor;
    private CommandBuffer scaleBuffer;
    private RenderTargetIdentifier src;
    
    //serialized for debug
    [SerializeField] private Camera camera;
    [SerializeField] private Rect originalRect;
    [SerializeField]  private Rect scaledRect;
    [SerializeField] private int dest = 0;
    [SerializeField] private Shader shader;
    [SerializeField] private Material material;
    
    private void Awake()
    {
        camera = GetComponent<Camera>(); //grab cam
        originalRect = camera.pixelRect; //store camera rect for later
        
        if (enableInternalResolution)
        {
            switch (InternalResolution) //set up values for downsampled rt
            {
                case internalResolution.Full:
                    width = 960;
                    height = 544;
                    renderDivisor = 1.0f;
                    break;
                case internalResolution.Mid:
                    width = 720;
                    height = 408;
                    renderDivisor = 1.334f;
                    break;
                case internalResolution.Low:
                    width = 640;
                    height = 368;
                    renderDivisor = 1.5f;
                    break;
                case internalResolution.PSP:
                    width = 480;
                    height = 272;
                    renderDivisor = 1.5f;
                    break;
            }
     
            //calc downsample res
            vDiv = Mathf.RoundToInt(width / renderDivisor);
            hDiv = Mathf.RoundToInt(height / renderDivisor);
        }
    } //end Awake()
    
    private void Start()
    {
        if (camera.commandBufferCount > 0) {
            camera.RemoveCommandBuffer(CameraEvent.AfterEverything, scaleBuffer); //clear cb's
            //set up command buffer for blitting
            scaleBuffer = new CommandBuffer();
        }
        shader = Shader.Find ("Blitter"); //get shader, because Internal/HiddenBlit is not working? This is an exact copy of that.
        material = new Material (shader); //create mat
        src = BuiltinRenderTextureType.CameraTarget;
        dest = Shader.PropertyToID("_MainTex"); //get prop ID for mainTexture
        if (Application.platform == RuntimePlatform.PSP2)
        {
            QualitySettings.vSyncCount = 2; //30Hz, supported resolutions only on PSV/PSTV
            switch (screenResolution)
            {
                case currentResolution.Full:
                    Screen.SetResolution(960, 544, true);
                    break;
                case currentResolution.Mid:
                    Screen.SetResolution(720, 408, true);
                    break;
                case currentResolution.Low:
                    Screen.SetResolution(640, 368, true);
                    break;
                case currentResolution.PSP:
                    Screen.SetResolution(480, 272, true);
                    break;
            }
        }
        else //60Hz on everything else, whatever resolution you happen to run
            QualitySettings.vSyncCount = 0;

        if (enableInternalResolution) //set our downsample dimensions if we are downscaling
        {
            scaledRect.Set(originalRect.xMin, originalRect.yMin,
                Mathf.RoundToInt(originalRect.xMax / renderDivisor), Mathf.RoundToInt(originalRect.yMax / renderDivisor));
        }
    } //end Start()
    
    private void OnDestroy()
    {
        camera.pixelRect = originalRect; //reset cam rect
    } //end OnDestroy()

    private void OnPreRender() //src is BuiltinRenderTextureType.CameraTarget, dest is our rt
    {
        if (camera.commandBufferCount > 1)
        {
            camera.RemoveCommandBuffers(CameraEvent.AfterEverything); //dump cb if there is one so we don't create one every frame
            //set up command buffer for blitting
            scaleBuffer = new CommandBuffer();
        }
        if (enableInternalResolution) //create rt for resolution scaling
        {
            camera.pixelRect = scaledRect; //scale cam rect to match buffer dimensions
            scaleBuffer.GetTemporaryRT(dest, vDiv, hDiv, 0, filterMode); //get cb rt, this throws nullref?
            scaleBuffer.SetRenderTarget(dest);
            scaleBuffer.SetGlobalTexture(material.mainTexture.ToString(), dest);
        }
        else if (!enableInternalResolution) //this works fine
        {
            scaleBuffer.Blit(src, src); //just blit to screen if we aren't scaling, no mat needed
            camera.AddCommandBuffer(CameraEvent.AfterEverything, scaleBuffer);//attach buffer to camera
            Graphics.ExecuteCommandBuffer(scaleBuffer); //execute early as we aren't scaling
        }
    }
    private void OnPostRender()
    {
        if (enableInternalResolution) //blit rt for resolution scaling
        {
            scaleBuffer.Blit(src, dest, material); //blit  to low res, this throws nullref?
            scaleBuffer.Blit(dest, src, material); //blit to cam scaling rt to original rect size
            scaleBuffer.ReleaseTemporaryRT(dest); //release rt so we arent accumulating DC's and temps
            camera.AddCommandBuffer(CameraEvent.AfterEverything, scaleBuffer); //attach buffer to camera
            Graphics.ExecuteCommandBuffer(scaleBuffer); //execute after low res blit
        }
        camera.pixelRect = originalRect; // resize cam rect to original- this doesnt happen?
    }//end OnPreRender()
}

