namespace TestRunnerPrivate {
template <
    class Map>
auto PrintMap(std::ostream& os, const Map& m) -> std::ostream&
{
    os << "{";
    bool first = true;
    for (const auto& kv : m) {
      if (!first) {
        os << ", ";
      }
      first = false;
      os << kv.first << ": " << kv.second;
    }
    return os << "}";
}
}
template <class T>
auto operator<<(std::ostream& os, std::initializer_list<T> list) -> std::ostream&
{
    bool first = true;
    for (T x : list) {
        if (!first) {
            os << " -> ";
        }
        first = false;
        os << x;
    }
    return os;
}

template <class T>
auto operator<<(std::ostream& os, const std::vector<T>& s) -> std::ostream&
{
    os << "{";
    bool first = true;
    for (const auto& x : s) {
        if (!first) {
            os << ", ";
        }
        first = false;
        os << x;
    }
    return os << "}";
}

template <class T>
auto operator<<(std::ostream& os, const std::set<T>& s) -> std::ostream&
{
