    bool first = true;
    for (const auto& x : s) {
        if (!first) {
            os << ", ";
        }
        first = false;
        os << x;
    }
    return os << "}";
}

template <class K, class V>
auto operator<<(std::ostream& os, const std::map<K, V>& m) -> std::ostream&
