            int x = cost % vec[i];
            myPq.push({x, vec[i]});
            canBeUsed[vec[i]] = true;
        }
    }


    while (q--) {
        int qq;
        cin >> qq;

        if (qq == 1) {
            int ans = -1;
            if (!myPq.empty()) {
                while (!myPq.empty()) {
                    if (canBeUsed.count(myPq.top().second) && canBeUsed[myPq.top().second]) {
                        if (myPq.top().second <= cost) {
                            ans = myPq.top().second;
                            break;
                        } else
                            break;
                    } else
                        myPq.pop();

                }
            }
            cout << ans << endl;
        }
        if (qq == 2) {
            cin >> x;
            if (x > cost)
                expensive.push_back(x);
            else
                myPq.push({cost % x, x});
            canBeUsed[x] = true;
        }
        if (qq == 3) {
            cin >> x;

            if (canBeUsed.count(x) && canBeUsed[x]) {
                canBeUsed[x] = false;
                cout << "Deleted Successfully" << endl;
            } else {
                cout << "Can't Delete" << endl;
            }
        }
    }

    while (!myPq.empty()) {
        if (canBeUsed[myPq.top().second])
            cout << myPq.top().second << " ";
        myPq.pop();
    }

    sort(expensive.begin(), expensive.end());
    for (auto it: expensive) {
        if (canBeUsed.count(it) && canBeUsed[it])
            cout << it << " ";
    }
    cout << endl;


    return 0;
}

